description:
Grizzly Bear is a Brooklyn-based indie rock band currently on Warp Records and consists of Daniel Rossen (songwriting/guitar), Ed Droste (songwriting/guitar), Chris Taylor (bass/woodwinds/electronics/vocals) and Christopher Bear (drums/vocals). The band employs traditional and electronic instruments, ranging from a recorder to a laptop, and all four members contribute vocals. Their sound is categorized as experimental rock, folk rock, or just indie rock, and is most dominated by the use of acoustic guitars and vocal harmonies. The band is one of the few non-electronic artists signed to Warp Records.


